import StyleSheet from '../../global-styles/styleSheet';
const abc = StyleSheet.primry_color;

const Footer = () => (
    <div>
        <div>
            <p className="text-center">
                Copyright@ 2020
                    <span> Muhalik </span>
                - Online Shopping Website
            </p>
        </div>
        <style jsx>{`
            div {
                position: absolute;
                left: 0;
                bottom: 0;
                right: 0;
                background: ${abc},
            }
            p {
                font-size: smaller;
            }
            span {
                font-size: medium;
                font-weight: bold;
            }
        `}</style>
    </div>
)

export default Footer;
